import React, {useEffect, useState} from 'react';
import './styles.css';
import loadingGif from '../../assets/loadingTwoWhite.gif';
import logoJP from '../../assets/logoJP.png';
import {Link, useNavigate, useParams} from "react-router-dom";
import {FiArrowRight} from "react-icons/fi";
import {ToastContainer, toast} from "react-toast";

import api from '../../services/api';

export default function NavBar() {

    return (
        <header>
            <nav className="navbar">
                <a href="#" className="logo"><img src={logoJP} alt="logoJP"/></a>
                <input type="checkbox" id="toggler"></input>
                <label for="toggler"><i className="ri-menu-items"></i></label>
                <div className="menu">
                    <ul className="list">
                        <li><a href="#">Home</a></li>
                        <li><a href="#">Users</a></li>
                    </ul>
                </div>
                <a href="#" className="logout"><FiArrowRight size={20} color="black" /></a>
            </nav>
        </header>
    )
}
